import date from "s-date";

import dangkyService from "../services/dangkyService";
import lopHocService from "../services/lopHocService";

class dangkyController {
  static async getAll(req, res) {
    try {
      const data1 = await dangkyService.getAll();
      var data = data1[0];
      const lophoc = await lopHocService.getAll();
      if (data.length > 0) {
        res.render("../views/admin/dangky/listdangky.ejs", {
          data,
          lophoc,
          date,
          message: 1
        });
      } else {
        res.render("../views/admin/dangky/listdangky.ejs", {
          data,
          lophoc,
          date,
          message: 0
        });
      }
    } catch (error) {
      return error;
    }
  }

  static async Delete(req, res) {
    let { id } = req.params;
    if (!Number(id)) {
      res.redirect("/admin/dangky");
      return; //util.send(res);
    }
    try {
      let Xoa = await dangkyService.delete(id);
      if (Xoa) {
        res.redirect("/admin/dangky");
      } else {
        res.redirect("/admin/dangky");
      }
      return;
    } catch (error) {
      return error;
    }
  }

  static async add(req, res) {
    let thanhtoan = req.body.thanhtoan;
    if (thanhtoan == "") {
      thanhtoan = 0;
    }
    let data = await { ...req.body, thanhtoan };
    try {
      const created = await dangkyService.add(data);

      if (created == null) {
        res.redirect("/admin/dangky");
      } else {
        res.redirect("/admin/dangky");
      }
    } catch (error) {
      return error;
    }
  }

  static async update(req, res) {
    let thanhtoan = req.body.thanhtoan;
    if (thanhtoan == "") {
      thanhtoan = 0;
    }
    let altered = await { ...req.body, thanhtoan };
    const { id } = req.params;
    try {
      const update = await dangkyService.Update(id, altered);
      if (!update) {
        res.redirect("/admin/dangky");
      } else {
        res.redirect("/admin/dangky");
      }
      res.redirect("/admin/dangky");
    } catch (error) {
      return error;
    }
  }

  static async get1(req, res) {
    const { id } = req.params;

    if (!Number(id)) {
      //   util.setError(400, 'Please input a valid numeric value');
      return; //util.send(res);
    }

    try {
      const thetk = await dangkyService.getByID(id);

      if (!thetk) {
        // util.setError(404, `Cannot find  with the id ${id}`);
      } else {
        // util.setSuccess(200, 'Found tai khoan', thetk);
      }
      return; // util.send(res);
    } catch (error) {
      //  util.setError(404, error);
      return; //util.send(res);
    }
  }


  
}

export default dangkyController;

